  `company_id_target` bigint(8) DEFAULT NULL COMMENT '濞戝牊浼呯憰浣稿絺闁胶娈戦惄顔炬畱閸︽澘鍙曢崣闈╃礉娑撹櫣鈹栫悰銊с仛閹碘偓閺堝鍙曢崣鎼佸厴閸?',
  `mq_mode` varchar(36) COLLATE utf8mb4_general_ci DEFAULT NULL COMMENT '发送模式，如简单一对一，简单一对多，交换机模式等',
  `exchange` varchar(255) COLLATE utf8mb4_general_ci DEFAULT NULL COMMENT '交换机',
  `queue` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci DEFAULT NULL COMMENT '目标队列',
  `routing` varchar(255) COLLATE utf8mb4_general_ci DEFAULT NULL COMMENT '路由标识',
  `operation` varchar(25) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci DEFAULT NULL COMMENT '操作类型：create,modify,delete',
  `priority_level` tinyint(1) NOT NULL COMMENT '同步优先级',
  `state` varchar(10) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL COMMENT '同步状态：draft,done,error',
  `description` varchar(225) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci DEFAULT NULL COMMENT '描述',
  `error_message` varchar(550) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci DEFAULT NULL COMMENT '错误消息',
  `synchro_time` datetime DEFAULT NULL COMMENT '同步时间',
  `creater_id` bigint(8) DEFAULT NULL COMMENT '閸掓稑缂撻悽銊﹀煕id',
  `creater_name` varchar(50) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci DEFAULT NULL COMMENT '创建用户名称',
  `modify_id` bigint(8) DEFAULT NULL COMMENT '閺堚偓閸氬孩娲块弬鎵暏閹寸d',
  `modify_name` varchar(50) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci DEFAULT NULL COMMENT '最后更新用户名称',
  `create_time` datetime DEFAULT NULL COMMENT '创建时间',
  `modify_time` datetime DEFAULT NULL COMMENT '最后更新时间',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=10000000 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_general_ci ROW_FORMAT=DYNAMIC COMMENT='数据同步记录表';

